import React from 'react';
import Header from '../components/Header';

const Games = () => {
  const games = [
    {
      title: 'LogicLoop',
      subtitle: 'Coding & Logic Challenge',
      icon: '💻',
      description: 'Solve complex programming puzzles and enhance your logical thinking skills through interactive coding challenges.',
      color: 'linear-gradient(45deg, #00FFFF, #00BFFF)',
      stats: { players: '10K+', challenges: 50, rating: '4.8' }
    },
    {
      title: 'CareerXp',
      subtitle: 'Career Skill Builder',
      icon: '🎯',
      description: 'Build essential career skills through realistic scenarios and challenges that simulate real workplace situations.',
      color: 'linear-gradient(45deg, #8A2BE2, #4B0082)',
      stats: { players: '8K+', challenges: 35, rating: '4.7' }
    },
    {
      title: 'HackQuest',
      subtitle: 'Hackathon Simulator',
      icon: '⚔️',
      description: 'Experience the thrill of hackathons with simulated projects, team collaborations, and time-bound challenges.',
      color: 'linear-gradient(45deg, #FF4500, #FF0000)',
      stats: { players: '12K+', challenges: 25, rating: '4.9' }
    }
  ];

  const stats = [
    { number: '10K+', label: 'Active Players' },
    { number: '50+', label: 'Challenges' },
    { number: '95%', label: 'Completion Rate' }
  ];

  return (
    <div style={{ paddingTop: '80px' }}>
      <Header />
      
      <div className="container" style={{ padding: '3rem 0' }}>
        {/* Header */}
        <div style={{ textAlign: 'center', marginBottom: '4rem' }}>
          <h1 className="gradient-text" style={{
            fontSize: '4rem',
            fontWeight: '700',
            marginBottom: '1rem'
          }}>
            Level Up with Learning Games 🎮
          </h1>
          <p style={{
            fontSize: '1.5rem',
            color: '#00BFFF',
            maxWidth: '600px',
            margin: '0 auto'
          }}>
            Transform your learning journey into an exciting adventure with our interactive games
          </p>
        </div>

        {/* Games Grid */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(3, 1fr)',
          gap: '2rem',
          marginBottom: '4rem'
        }}>
          {games.map((game, index) => (
            <div 
              key={game.title}
              className="card glow-border holographic"
              style={{ 
                textAlign: 'center',
                padding: '2rem',
                position: 'relative',
                overflow: 'hidden',
                animationDelay: `${index * 0.2}s`
              }}
            >
              {/* Background Gradient */}
              <div style={{
                position: 'absolute',
                top: 0,
                left: 0,
                right: 0,
                height: '4px',
                background: game.color
              }}></div>
              
              {/* Icon */}
              <div style={{
                width: '80px',
                height: '80px',
                background: game.color,
                borderRadius: '20px',
                margin: '0 auto 1.5rem',
                display: 'flex',
                alignItems: 'center',
                justifyContent: 'center',
                fontSize: '2.5rem'
              }}>
                {game.icon}
              </div>
              
              {/* Content */}
              <h3 style={{
                color: 'white',
                fontSize: '1.75rem',
                marginBottom: '0.5rem'
              }}>
                {game.title}
              </h3>
              <p style={{
                color: '#00FFFF',
                fontSize: '1.1rem',
                fontWeight: '600',
                marginBottom: '1rem'
              }}>
                {game.subtitle}
              </p>
              <p style={{
                color: '#00BFFF',
                lineHeight: '1.6',
                marginBottom: '1.5rem'
              }}>
                {game.description}
              </p>
              
              {/* Stats */}
              <div style={{
                display: 'flex',
                justifyContent: 'space-around',
                marginBottom: '2rem',
                padding: '1rem',
                background: 'rgba(255, 255, 255, 0.05)',
                borderRadius: '10px'
              }}>
                <div style={{ textAlign: 'center' }}>
                  <div style={{ color: 'white', fontWeight: '600' }}>{game.stats.players}</div>
                  <div style={{ color: '#00BFFF', fontSize: '0.8rem' }}>Players</div>
                </div>
                <div style={{ textAlign: 'center' }}>
                  <div style={{ color: 'white', fontWeight: '600' }}>{game.stats.challenges}</div>
                  <div style={{ color: '#00BFFF', fontSize: '0.8rem' }}>Challenges</div>
                </div>
                <div style={{ textAlign: 'center' }}>
                  <div style={{ color: 'white', fontWeight: '600' }}>{game.stats.rating}</div>
                  <div style={{ color: '#00BFFF', fontSize: '0.8rem' }}>Rating</div>
                </div>
              </div>
              
              {/* Play Button */}
              <button 
                className="btn-primary"
                style={{
                  width: '100%',
                  background: game.color,
                  border: 'none'
                }}
              >
                Play Now
              </button>
            </div>
          ))}
        </div>

        {/* Stats Section */}
        <div style={{
          display: 'grid',
          gridTemplateColumns: 'repeat(3, 1fr)',
          gap: '1.5rem'
        }}>
          {stats.map((stat, index) => (
            <div 
              key={stat.label}
              className="card"
              style={{ 
                textAlign: 'center',
                padding: '2rem',
                animationDelay: `${index * 0.1}s`
              }}
            >
              <div className="gradient-text" style={{
                fontSize: '2.5rem',
                fontWeight: '700',
                marginBottom: '0.5rem'
              }}>
                {stat.number}
              </div>
              <div style={{
                color: '#00BFFF',
                fontSize: '1.1rem',
                fontWeight: '600'
              }}>
                {stat.label}
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Games;
